        console.log("fetch")
        setInterval(async () => {
            setData(await StudentService.fetchAllStudents())
        }, 1000 * 10)

    }

    useEffect(() => {
        console.log("useEff")
        fetchData().then()
    }, [data])

    return (
        <StudentList data={data}/>
    )

}

